@EU_Commission Nothing. Catalans are discriminated in Europe:
1- Our vote doesn't count. We voted for MEPs - elect @KRLS Puigdemont, @junqueras and @toni_comin, where is our vote?

2- Spain has political prisoners and exiles, inside the EU. We have denounced it but @EU_Commission keeps silent.

@EU_Commission Right now, it is mostly a shameful &amp; hypocritical institution. 
EU allows 2.000.000 voters be witout representation after legal elections (@KRLS).
And it keeps saying Catalonia Crisis is just a Spanish problem (after putting 19 Regional Politicians in exile or jail for a decade)

@EU_Commission For me personally, Europe brought many benefits like freedom of movement. 

For the Catalans who lost their eyes to police bullets, the EU did nothing but side with the oppressor.  

This time I side with the Catalans.

@EU_Commission Europe has flushed my vote.

Respect my vote 
#SpainSitAndTalk

@EU_Commission What does europe do for me?
Nothing
I am catalan

@EU_Commission What Europe does for Catalans is to steal our votes.

None of the three most voted MEPs in Catalonia could claim their seats.

How can you call yourself a democracy, @EU_Commission?

@EU_Commission Nothing at all. Well, maybe looking while they beat us Catalans.
You don't even respect what I voted.
#spainisafaciststate and #Europe ignores it.

@EU_Commission What #EU does for me and my #Catalan fellow citizens is ignore &amp; despise our democratic rights (and a long list of our fundamental rights) letting #SpainIsAFascistState deploy relentless &amp; brutal repression against dissent.
#StandUpForCatalonia 
#StandUp4HumanRights

@EU_Commission No more lies, fascists!!
Your silence is connivance with a fascist State as Spain!!
Catalans must pay taxes but we don't have political rights!!

@EU_Commission Catalans are discriminated in this Europe:

1 - Our vote doesn't count. We voted for MEPs - elect @KRLS Puigdemont, @junqueras and @toni_comin, where is our vote?

2- Spain has political prisoners and exiles, inside the EU. We have denounced it but @EU_Commission keeps silent.

@EU_Commission "Adaptada a vuestras opiniones"

Las de los Catalanes también?

Es q teneis 2.200.000 de voces Catalanas y no os interesan. De los Catalanes solo quereis sus impuestos, que paguen y callen. Es eso?
